import React from "react";
import { useParams } from "react-router-dom";

const SubCategory = () => {
  const { id } = useParams();

  return (
    <div>
      <h1>Sub Category Page</h1>
      <p>ID: {id}</p>
    </div>
  );
};

export default SubCategory;
